-- View structure for fr_total
-- ----------------------------
DROP VIEW IF EXISTS `fr_total`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `fr_total` AS select distinct `view_frp_factura`.`Factura` AS `FACTURA`,`view_frp_factura`.`SALDO` AS `SALDO` from `view_frp_factura` union all select distinct `view_fre_factura`.`Factura` AS `FACTURA`,1 AS `1` from `view_fre_factura` ;

-- ----------------------------
-- View structure for view_all_fre
-- ----------------------------
DROP VIEW IF EXISTS `view_all_fre`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `view_all_fre` AS select `fre`.`Fecha` AS `Fecha`,`fre`.`IdFRE` AS `IdFRE`,`fre`.`IdCliente` AS `IdCliente`,`fre`.`Nombre` AS `Nombre`,sum(`detallefre`.`Puntos`) AS `Puntos`,sum(`detallefre`.`Efectivo`) AS `Efectivo`,`fre`.`Anulado` AS `Anulado` from (`fre` join `detallefre` on((`fre`.`IdFRE` = `detallefre`.`IdFRE`))) group by `fre`.`IdFRE`,`fre`.`Anulado` ;

-- ----------------------------
-- View structure for view_canje_premios
-- ----------------------------
DROP VIEW IF EXISTS `view_canje_premios`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `view_canje_premios` AS select `t0`.`IdFRP` AS `IdFRP`,`t1`.`Fecha` AS `Fecha`,`t1`.`IdCliente` AS `IdCliente`,`t1`.`Nombre` AS `Nombre`,`t0`.`IdArticulo` AS `IdArticulo`,`t0`.`Descripcion` AS `Descripcion`,(select (sum(`t0`.`Puntos`) / `t2`.`Puntos`) from `detallect` `t2` where ((`t0`.`IdCT` = `t2`.`IdCT`) and (`t0`.`IdArticulo` = `t2`.`IdIMG`))) AS `CANTIDAD`,(sum(`t0`.`Puntos`) / `t0`.`Cantidad`) AS `PUNTO` from (`detallefrp` `t0` join `frp` `t1` on((`t1`.`IdFRP` = `t0`.`IdFRP`))) where (`t1`.`Anulado` = 'N') group by `t0`.`IdFRP`,`t0`.`IdArticulo` ;

-- ----------------------------
-- View structure for view_catalogo_activo
-- ----------------------------
DROP VIEW IF EXISTS `view_catalogo_activo`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `view_catalogo_activo` AS select `detallect`.`IdIMG` AS `IdIMG`,`detallect`.`Nombre` AS `Nombre`,`detallect`.`IMG` AS `IMG`,`detallect`.`Puntos` AS `Puntos`,`catalogo`.`Descripcion` AS `Descripcion`,`catalogo`.`IdCT` AS `IdCT` from (`catalogo` left join `detallect` on((`detallect`.`IdCT` = `catalogo`.`IdCT`))) where (`catalogo`.`Estado` = 0) ;

